// src/components/Home.js
import React from 'react';
import './Home.css';

const technicalSkills = [
  // your skills array here as is
];

const Home = () => {
  return (
    <div>
      {/* Hero Section */}
      <section id="hero">
        <h1>Welcome to my portfolio!!!</h1>
        <p>Welcome to My Portfolio!</p>
        <button
          onClick={() => window.scrollTo({ top: window.innerHeight, behavior: 'smooth' })}
        >
          Explore
        </button>
      </section>

      {/* Career Objective */}
      <section id="career-objective" className="section">
        <h2>Career Objective</h2>
        <p>
          Graduate in Bachelor of Information Technology from Melbourne Polytechnic with
          industry-based project experience. Experienced in Python, WordPress, HTML5, CSS,
          and JavaScript. Previously an IT Software Developer intern at 10th Dan, Melbourne.
          Currently a Multi-Site Store Manager with 5 years customer service experience.
          Seeking to develop an IT career and skillset.
        </p>
      </section>

      {/* Technical Skills */}
      <section id="technical-skills" className="section">
        <h2>Technical Skills</h2>
        <div className="technical-skills">
          {technicalSkills.map((skill, idx) => (
            <div
              key={skill.name}
              className="skill-item"
              style={{ animationDelay: `${0.1 * idx}s` }}
              title={skill.name}
            >
              <img src={skill.img} alt={skill.name} />
              <div>{skill.name}</div>
            </div>
          ))}
        </div>
      </section>

      {/* Education */}
      <section id="education" className="section">
        <h2>Education</h2>
        <div className="education-content">
          <div>
            <p>Bachelor of Information Technology (Software Development)</p>
            <p>Melbourne Polytechnic, July 2019 – July 2022</p>
          </div>
          <img
            src="/logo/mp.jpg"
            alt="Melbourne Polytechnic"
            title="Melbourne Polytechnic"
          />
        </div>
      </section>

      {/* Professional Development */}
      <section id="professional-development" className="section">
        <h2>Professional Development</h2>
        <div className="professional-development-list">
          {[ /* your certificates array here, with className="cert-item" and animationDelay inline style like above */].map((cert, i) => (
            <div
              key={cert.name}
              className="cert-item"
              style={{ animationDelay: `${0.1 * i}s` }}
              title={cert.name}
            >
              <img src={cert.img} alt={cert.alt} />
              <span>{cert.name}</span>
            </div>
          ))}
        </div>
      </section>

      {/* Work Experience */}
      <section id="work-experience" className="section">
        <h2>Work Experience</h2>
        {/* Your work experience content here */}
      </section>

      {/* References */}
      <section id="references" className="section">
        <h2>References</h2>
        {/* Your references content here */}
      </section>
    </div>
  );
};

export default Home;
